import React from 'react';

class Table extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            eventError: null,
            isLoadedEvents: false,
            eventItems: [],
            venueError: null,
            isLoadedVenue: false,
            venueItems: [],
            artistError: null,
            isLoadedArtist: false,
            artistItems: [],
            size: 3, 
        };
    }

    componentDidMount() {


        fetch("https://oll-coding-exercise.s3-us-west-2.amazonaws.com/venues.json")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        isLoadedVenue: true,
                        venueItem: result.items
                    })
                }
            )

        fetch("https://oll-coding-exercise.s3-us-west-2.amazonaws.com/artists.json")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        isLoadedArtists: true,
                        artistItems: result.items
                    })
                }
            )


    }

    
    render() {
        let rows = [];
        for (var i = 0; i < this.state.size; i++) {
            let rowID = `row${i}`
            let cell = []
            for (var idx = 0; idx < this.state.size; idx++) {
                let cellID = `cell${i}-${idx}`
                cell.push(<td key={cellID} id={cellID}></td>)
            }
            rows.push(<tr key={i} id={rowID}>{cell}</tr>)
        }
        return (
            <div className="container">
                <div className="row">
                    <div className="col s12 board">
                        <table id="simple-board">
                            <tbody>
                                {rows}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        )
    }       
}


export default Table;
